import React, { Component } from 'react'
import { Route, Switch} from 'react-router-dom';
import Layout from './Layout/Layout';
import Home from './components/Home/Home';
import signIn from './components/signin/SignIn';
import signUp from './components/signin/SignUp';
import dashboard from './components/dashboard/dashboard';
import Wallet from './components/dashboard/Wallet';
import {Redirect} from 'react-router-dom';
import './components/dashboard/dash.css';
import DashboardPage from './components/dashboard/pages/DashboardPage';
import profilePage from './components/dashboard/pages/ProfilePage';
import TablesPage from './components/dashboard/pages/TablesPage';
import MapsPage from './components/dashboard/pages/MapsPage';
import NotFoundPage from './components/dashboard/pages/NotFoundPage';
import PrivateRouters from './components/signin/PrivateRouters';
// import {PrivateRouter} from './components/signin/SignIn';
class Routes extends Component {
    render() {
        return (
                <Switch>
                    <Route path="/" exact component={Home}/>
                    {/* <PrivateRouters  path="/dash" exact component={DashboardPage}/> */}
                    <Route path="/SignUp" component={signUp}/>
                    <Route path="/SignIn" component={signIn}/>
                    <Route path="/Wallet" component={Wallet} />
                    <PrivateRouters  exact path='/dashboard' component={dashboard} />
                    <Route path="/profile" component={profilePage}/>
                    <Route path="/tables" component={TablesPage}/>
                    <Route path="/maps" component={MapsPage}/>
                    <Route path="/404" component={NotFoundPage}/>
                </Switch>
        )
    }
}
export default Routes;
